import { createClient } from 'contentful';

const clientConfig = {
	  space: '2q66jr3wkfx6',
	  environment: 'master',
	  accessToken: 'X415_UM9qcA9TrD_2IMWl1QbCQIvLE9ea9korxh81u8'
};

const portfolioClientConfig = {
	  space: '2q66jr3wkfx6',
	  environment: 'master',
	  accessToken: 'X415_UM9qcA9TrD_2IMWl1QbCQIvLE9ea9korxh81ugmtvRN4513lSzR6ZBeNMUWx-qA8gTQD_ZPiYOJY'
};

const client = createClient(clientConfig);
const portfolioClient = createClient(portfolioClientConfig);

client.getEntries()
  .then((response) => console.log('Items:', response.items))
  .catch(console.error);

portfolioClient.getEntries()
  .then((response) => console.log('Portfolio items:', response.items))
  .catch(console.error);

export { client, portfolioClient };
